package com.yun.jun162smvc.cal;

// 멤버변수명과 요청파라메터명 같게
public class XY {
	private int xx;
	private int yy;
	public XY() {
		// TODO Auto-generated constructor stub
	}
	public XY(int xx, int yy) {
		super();
		this.xx = xx;
		this.yy = yy;
	}
	public int getXx() {
		return xx;
	}
	public void setXx(int xx) {
		this.xx = xx;
	}
	public int getYy() {
		return yy;
	}
	public void setYy(int yy) {
		this.yy = yy;
	}
	
	
}
